    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="chat">
        <div className="container">
          <div className="row">
            <div className="col">
              <div className="row ">
                <div className="col-lg-4 satu">
                  <div className="row">
                    <nav class="navbar fixed-top navbar-light bg-light">
                      <a class="navbar-brand" href="##">
                        <img src={human} alt=""/>
                      </a>
                      <div className="clear"></div>
                    </nav>
                  </div>
                </div>
                <div className="col dua">dua</div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Chat;
